  false,\n\t\"url\": null,\n\t\"notes\": \"This table represents details of Medicaid
  income levels (ages 65 and up). Medicaid provides free health insurance for low-income
  older adults. Eligible adults receive their medical care through a managed care
  plan or fee-for-service. While ones application is being processed, Medicaid may
  provide up to 90 days of retroactive coverage for unpaid medical bills, if the individual
  is eligible during those 90 days.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
